    false,nt"url": null,nt"notes": "This annual narrative report for Roanoke
    River National Wildlife Refuge summarizes Refuge activities during the 1998 calendar
    year.  The report begins with an introduction to the Refuge and a summary of the
    yearu2019s highlights and climatic conditions.  Information about monitoring and
    studies- including surveys and censuses- is provided next.  Habitat restoration
    and management projects are also covered; activities include wetland restoration,
    moist soil management, and forest cutting.  Fish and wildlife management is discussed
    next with emphasis on bird banding, nest structures, and predator/exotic control.
     Coordination activities, such as interagency coordination, private lands activities
    (easements), and cooperative/friends organizations, are outlined.  The resource
    protection section provides information about law enforcement and land acquisition.
     Information about public education and recreation is given including insert public
    education topics.  Finally, Refuge planning and administration are discussed.",nt"license_title":
